import React from "react";
import "../timeline/TimeLineCards.css";
import ourfirstlogo from "../images/ourfirstlogo.png";
import uztracking from "../images/uztracking.png";
import azamaka from "../images/azamaka.png";
import afterazamaka from "../images/afterazamaka.png";

const TimeLineCards = () => {
  return (
    <div id="timeline" className="cardTitle">
      <div className="timeline">
        <h1>Timeline </h1>
      </div>
      <div className="container">
        <div className="card card-background-image">
          <div className="card-image">
            <div className="image-holder"></div>
          </div>
          <div className="card-title">
            <h2>Edgar Allen Poe</h2>
          </div>
          <div className="card-content">
            <p>
              Lorem ipsum sit dolor amet bonkers bacon sirloin feeling lucky
              punk I'd like to ass you a few questions Do you know why I use a
              knife? Guns are too fast, you can't - savor - all the little
              emotions
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};
export default TimeLineCards;
